body {
padding: 0px;
margin: 0px;
font-family: Verdana, Arial, Sans-serif;
font-size: 18px;
line-height: 26px;
color: #404040;
background-color: #FFFFFF;
}
textarea,
button,
input.text,
input[type='text'],
input[type='button'],
input[type='submit'],
.input-checkbox {
-webkit-appearance: none;
border-radius: 0;
}
h1 {
padding: 0px 20px;
margin: 20px 0px;
font-family: Verdana, Arial, Sans-serif;
font-size: 40px;
line-height: 45px;
color: #404040;
font-weight: bold;
text-align: center;
clear: both;
}
h2 {
padding: 0px 20px;
margin: 20px 0px;
font-family: Verdana, Arial, Sans-serif;
font-size: 28px;
line-height: 38px;
color: #fbce07;
font-weight: bold;
text-align: center;
clear: both;
}
h3{
color: #fbce07;
font-family: Verdana, Arial, Sans-serif;
font-size: 14px;
line-height: 24px;
font-weight: bold;
padding: 0 20px;
margin: 20px 0 10px 0;
text-align: center;
}
textarea {
border: none;
background-color: #f7f7f7;
width: 100%;
padding: 10px;
color: #595959;
font-family: Verdana, Arial, Sans-serif;
font-size: 14px;
line-height: 24px;
}
#button {
padding: 15px 20px;
margin: 30px 0px;
font-family: Verdana, Arial, Sans-serif;
font-size: 14px;
line-height: 24px;
color: #404040;
background-color: #fbce07;
font-weight: bold;
text-align: center;
border: 3px solid #fbce07;
cursor: pointer;
clear: both;
}
#button:hover {
color: #404040;
background-color: #FFFFFF;
border: 3px solid #fbce07;
}
#buttonthankyou {
padding: 15px 20px;
margin: 0px 0px 30px 0px;
font-family: Verdana, Arial, Sans-serif;
font-size: 14px;
line-height: 24px;
color: #404040;
background-color: #fbce07;
font-weight: bold;
text-align: center;
border: 3px solid #fbce07;
cursor: pointer;
clear: both;
}
#buttonthankyou:hover {
color: #fbce07;
background-color: #404040;
border: 3px solid #fbce07;
}
p {
padding: 0px 20px;
margin: 10px 0px;
font-family: Verdana, Arial, Sans-serif;
font-size: 14px;
line-height: 24px;
color: #404040;
text-align: center;
clear: both;
}
div, td, table, span, a {
font-family: Verdana, Arial, Sans-serif;
font-size: 18px;
line-height: 26px;
color: #404040;
}
#header {
display: table;
width: 100%;
padding: 0px;
box-sizing: border-box;
}
#footer {
display: table;
width: 100%;
padding: 20px 0px;
box-sizing: border-box;
border-top: 1px solid #dcdcdc;
}
#form {
background-color: #FFFFFF;
display: table;
width: 100%;
padding: 30px 0px;
box-sizing: border-box;
}
#footertop {
background: url(https://image.s50.sfmc-content.com/lib/fe2e117075640474721177/m/1/eafeb6c5-0e4f-459e-b404-67d6baad32c5.png);
background-position: center 100%;
background-repeat: no-repeat;
background-size: cover;
height:1300px;
}
#footerbottom {
background-color: #e3e3e3;
display: table;
width: 100%;
margin-top: -5px;
}
.page {
max-width:600px;
margin: auto;
}
.imglink {
text-decoration: none;
}
img {
display: block;
border: none;
}
form {
padding: 0px 20px;
margin: 0px;
}
.container {
margin: 0px 10px;
}
select {
width: 150px;
height: 30px;
text-align: left;
padding: 3px;
}
.containerbox {
display: block;
position: relative;
padding-left: 35px;
margin-bottom: 12px;
cursor: pointer;
font-size: 22px;
-webkit-user-select: none;
-moz-user-select: none;
-ms-user-select: none;
user-select: none;
}
.containerbox input {
position: absolute;
opacity: 0;
cursor: pointer;
height: 0;
width: 0;
}
.checkmark {
position: absolute;
top: 0;
left: 0;
height: 25px;
width: 25px;
background-color: #eee;
}
.containerbox:hover input ~ .checkmark {
background-color: #ccc;
}
.containerbox input:checked ~ .checkmark {
background-color: #2196F3;
}
.checkmark:after {
content: "";
position: absolute;
display: none;
}
.containerbox input:checked ~ .checkmark:after {
display: block;
}
.containerbox .checkmark:after {
left: 9px;
top: 5px;
width: 5px;
height: 10px;
border: solid white;
border-width: 0 3px 3px 0;
-webkit-transform: rotate(45deg);
-ms-transform: rotate(45deg);
transform: rotate(45deg);
}
.selectt {
display: none;
}
#checkFormat{
        width: 50%;
        float: left;
        font-family: Verdana, Arial, Sans-serif;
        font-size: 14px;
        line-height: 24px;
        color: #404040;
      }
.questionTwo-container {
            display: flex;
            justify-content: space-between;
            flex-wrap: wrap;
            margin: 0 20px;
        }

        .questionTwo-container > div {
            flex: auto;
            font-family: Verdana, Arial, Sans-serif;
        font-size: 14px;
        line-height: 24px;
        color: #404040;
        }
@media only screen and (max-width: 1024px) {
#footertop {
height:700px;
}
#cloud {
height:180px;
}
}
@media only screen and (max-width: 768px) {
#footertop {
height:400px;
}
#cloud {
height:120px;
}
#footerbottom {
padding-bottom: 20px  !important;
}
#footerleft, #footerright {
width: 100% !important;
float: none !important;
text-align: center !important;
padding: 5px 20px;
}
}

